import React from "react";

const NavBar = () => {
  return (
    <div className="navbar">
      <div className="brand-title">Brand Name</div>
      <div className="navbar-links">
        <ul>
          <li>
            <a href="#">Home</a>
            <a href="#">About</a>
            <a href="#">Contact</a>
          </li>
        </ul>
      </div>
    </div>
  );
};

export default NavBar;
